import React, { useState } from "react";
import Home from "../Home/Home";
function Dropdownm() {
  const [show, setShow] = useState(false);
  const display = () => {
    setShow(!show);
  };
  return (
    <React.Fragment>
      <button onTouchMove={display}>Hello</button>
      {show && <div>New component</div>}
    </React.Fragment>
  );
}
export default Dropdownm;
